function parseBankAccounts(){let bankAccounts=[];return $(".view_57 .kn-list-content .kn-list-item-container").each((function(){let bankAccount={};$(this).find(".kn-detail").each((function(){let label=$(this).find(".kn-detail-label span span").text(),detailKey=label.split(" ").join(""),detailVal=$(this).find(".kn-detail-body span span").text();if("AccountBank"===detailKey&&(detailVal=$(this).find(".kn-detail-body span span span").text()),"BankLogo"===detailKey){let img=$(this).find(".kn-detail-body span span span img");detailVal=$(img).attr("src")}bankAccount[detailKey]={label:label,value:detailVal}})),bankAccounts.push(bankAccount)})),bankAccounts}function creatBankAccountList(){let bankAccounts=parseBankAccounts(),bankAccountsList="";bankAccounts.forEach((bankAccount,index)=>{let bankAccountTemplate=`\n            <div class="bank-account-item bordered">\n                <img src="${bankAccount.BankLogo.value}" alt="bank account logo" width="56" height="56" class="img-bank" />\n            \n                <div class="bci-content">\n                    <span class="bci-bank-name">${bankAccount.AccountBank.value}</span>\n                    <span class="bci-account">${bankAccount.AccountNumber.value}</span>\n                </div>\n            </div>\n        `;bankAccountsList+=bankAccountTemplate});let linkedAccounts=`\n        <div class="main-accounts-container">\n            <div class="accounts-header">\n                <span class="ah-title">Linked Accounts</span>\n            </div>\n\n            ${bankAccountsList}\n        </div>\n    `;$(".bank-accounts-container").append(linkedAccounts)}function loadHomeView(){creatBankAccountList()}